import { Setting } from "./../models/Setting";

export const MODES = Object.freeze({
    POMODORO: 0,
    SHORT_BREAK: 1,
    LONG_BREAK: 2
});

export const PAGES = Object.freeze({
    TIMER: 0,
    SETTINGS: 1
});

export const SETTINGS = Object.freeze([
    new Setting("hi", "hewwo")
]);
